import React from 'react';

const ModalContent = ({ title, items = []}) => {
   console.log(items)
    return (
        <div>
            <h3>{title}</h3>
            <div>
                {items !== undefined && items.map((item, id) => {
                        return(
                        <div>
                            <h5 key={id.id}>{item.name}</h5>

                        </div>





                        )
                    }
                )}
            </div>
        </div>
    );
}

export default ModalContent;
